import React from 'react'
import styled from 'styled-components'

const Navbarall = styled.div`
width : 100%;
height : 60px;
display : flex;
align-items : center;
justify-content : space-around
`


const Imgdiv = styled.div`
width  : 10%;
height : 60px;
`
const Userinfo = styled.div`
width : 20%;
height : 60px;
border : solid 1px white
`



function Navbar() {



  return (
    <div>
    <Navbarall>
    <Imgdiv>
    <img src = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQAGAKKpRvnKiKVxgSGror92eROldFG1oCuMcEis8aORGPZEcQ_YY4hw4iY3edx7voiBnY&usqp=CAU" className = "img-fluid"/>
    </Imgdiv>
    </Navbarall>
    </div>
  )
}

export default Navbar
